import { Auth0Provider } from '@auth0/auth0-react';
import HomePage from '../Components/HomePage.jsx';
import ClassroomList from '../Components/ClassroomList.jsx';

import ClassroomView from '../Components/ClassroomView.jsx';
import CreateClassroom from '../Components/CreateClassroom.jsx';


import { BrowserRouter as Router, Route } from 'react-router-dom';






const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Auth0Provider
  domain="dev-147umiv5h85hvjw1.us.auth0.com"
  clientId="FH2Q3oyoJZfKm1NbPBrWhH4PGs5BlnlE"
  authorizationParams={{
    redirect_uri: window.location.origin
  }}
> 



<Router>

<Routes>

      <Route path="/" element={<Home />} />

      {/* <Route path="/Auth" element={<Auth />} /> */}
      {/* <Route path="/Login" element={<Login />} /> */}
      <Route path="/Home" element={<Home />} />
      <Route path="/Student" element={<Student />} />
      <Route path="/Teacher" element={<Teacher />} />
      <Route path="/AboutUs" element={<AboutUs />} />
      <Route path="/Services" element={<Services />} />
      <Route path="/ContactUs" element={<ContactUs />} />
    </Routes>

      </Router>
</Auth0Provider>


);

// If you want to start measuring performance in your app, pass a function
